import React from 'react'
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

import { AboutScreen } from './AboutScreen';

export const AppRouter = () => {
  return (
    <Router>
        <div>
            <Routes>
                <Route path='/about' element={AboutScreen}/>

            </Routes>
        </div>
    </Router>
  )
}
